FeedPackage.ReleaseNotes:
Initial release:-

ColorConsole.WriteLine("Hello ".Yellow(), "world!".Cyan());
ColorConsole.WriteLine(
    "It's so easy to add some ", "color".Red(), " to your console.");
ColorConsole.WriteLine(
    "Even ", "dynamically!".Color((ConsoleColor)new Random().Next(1, 14)));

var text = new ColorText("You can even use ", "masking".Magenta(), ".");
ColorConsole.WriteLine(text.Coalesce(ConsoleColor.DarkYellow));
ColorConsole.WriteLine(text.Coalesce(ConsoleColor.DarkCyan));

