0.2.0:-

ColorConsole.WriteLine("Now set ".Yellow().BlueBackground(), "the background color too!".Cyan().MagentaBackground());
var text = new ColorText("With or without ", "masking".Magenta().DarkMagentaBackground(), ".");
ColorConsole.WriteLine(text.Coalesce(ConsoleColor.DarkYellow));
ColorConsole.WriteLine(text.Coalesce(ConsoleColor.DarkCyan, ConsoleColor.DarkRed));

